import React, { Component } from "react";
import ClipBar from "../ClipBar/main";
import "./base.css";
export default class index extends Component {
  render() {
    return (
      <div className="container-main">
        <div className="float-wrapper">
          <div style={{ float: "left" }}>
            <ClipBar />
          </div>
        </div>
      </div>
    );
  }
}
